7"},"source":{"id":"1124837"},"volume_range":{"id":"1125044"}},"code":"if (!window._bt_scale_range) {\n    window._bt_scale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1125156","type":"CustomJS"},{"attributes":{"data":{"x":[164,1258]},"selected":{"id":"1124988"},"selection_policy":{"id":"1124987"}},"id":"1124964","type":"ColumnDataSource"},{"attributes":{},"id":"1125004","type":"BasicTicker"},{"attributes":{"data":{"Close":{"__ndarray__":"AAAAAABIYEC4HoXrURBgQK5H4XoU/l9Aj8L1KFy/X0ApXI/C9ZhfQHsUrkfhKl9AUrgehethX0B7FK5H4cpfQPYoXI/CtV9ArkfhehSuX0AK16NwPcpdQLgehetRuFxAMzMzMzOzXEA9CtejcL1cQHsUrkfhGl1AmpmZmZkJXUCkcD0K15NdQM3MzMzMTF1AFK5H4Xo0XUAAAAAAAABdQI/C9Shcn11Aw/UoXI8SXkCF61G4HjVeQD0K16NwrV1AhetRuB4VXkCkcD0K1xNeQMP1KFyPIl5Aw/UoXI/CXUCamZmZmVldQLgehetRmF1AhetRuB6VXUCF61G4HlVdQHE9CtejwF1ApHA9CtfjXUBcj8L1KNxdQFyPwvUo7F1AhetRuB6lXkApX
